description:
The Age of Decadence is an isometric, turn-based, single-player 3D role-playing game set in a low magic, post-apocalyptic fantasy world, inspired by the fall of the Roman Empire. The game features a detailed skill-based character system, non-linear gameplay, multiple skill-based ways to handle quests, choices &amp; consequences, and extensive dialogue trees.
